import React from 'react';

export default function Summary() {
  return (
    <div className='Summary'>
      <h4>About Me</h4>
      <p>I graduated from the University of Toronto in 2018 majoring in Poltical Science, Spanish and Philosophy. In 2019, I worked for a non-profit</p>
      <p>non-profit organization in Québec City called l'Arche Étoile caring for persons</p>
      <p>with intellectual disabilities</p>
      <br></br>
      <p>I rediscovered programming through the 'Introduction to JavaScript' course on Codecademy and was hooked</p>
      <p>Shortly thereafter, I discovered and applied to the Full-Stack Web Development Bootcamp at Lighthouse Labs</p>
      <br></br>
      <p>I graduated from the bootcamp in July 2020</p>
    </div>
  )
}
